import React from 'react'
import "./Chat.css";
import { Avatar } from '@mui/material';
function Chat() {
  return (
    <div className='chat'>
      <div className="chatHeader">
        <Avatar />
        <div className="chatHeaderInfo">
            <h3>Room Name</h3>
        </div>
      </div>
    </div>
  )
}

export default Chat
